              "col1": "\u003cdiv title\u003d\"Election Jurisdiction\" style\u003d\"display: inline !important; white-space: nowrap !important; height: 20px;\"\u003e\u003ca href\u003d\"\" target\u003d\"_blank\" onclick\u003d\"navigate(\u0027OrganizationStructure___18_5_1_11940316_1498999818037_96552_21933\u0027);return false;\"\u003e\u003cspan style\u003d\"vertical-align: middle;\"\u003e\u003cimg src\u003d\u0027images/icon_212.png\u0027 width\u003d\u002716\u0027 height\u003d\u002716\u0027 title\u003d\u0027\u0027 style\u003d\"vertical-align: bottom;\"\u003e\u003c/span\u003e\u003ca\u003e \u003ca href\u003d\"\" target\u003d\"_blank\" onclick\u003d\"navigate(\u0027OrganizationStructure___18_5_1_11940316_1498999818037_96552_21933\u0027);return false;\"\u003eElection Jurisdiction\u003ca\u003e\u003c/div\u003e\u003c/br\u003e",
