              "col0": "\u003cdiv title\u003d\"Configure machines\" style\u003d\"display: inline !important; white-space: nowrap !important; height: 20px;\"\u003e\u003cspan style\u003d\"vertical-align: middle;\"\u003e\u003cimg src\u003d\u0027images/icon_270.png\u0027 width\u003d\u002716\u0027 height\u003d\u002716\u0027 title\u003d\u0027\u0027 style\u003d\"vertical-align: bottom;\"\u003e\u003c/span\u003e Configure machines\u003c/div\u003e\u003c/br\u003e",
